import Main from "../App/Pages/Main";
import TitlePAge from "../App/Pages/TitlePage";
import UserPage from "../App/Pages/UserPage";
import TabVersion from "../App/TabVersion";
import DesktopVersion from "../App/DesktopVersion";
import SignIn from "../App/Pages/SignIn";
import SignUp from "../App/Pages/SignUp";




export default Routes = (isAuthenticated) => {[
    {
      name: 'app',
      url:"/",
      component: DesktopVersion,
      redirectTo: "app.main",
    },
    {
      name: 'app.main',
      url:"main",
      component: Main,
    },
    {
      name: 'app.categories',
      url:"categories",
      component: null,
    },
    {
      name: 'app.account',
      url:"account",
      component: UserPage,
    },
    {
      name: 'app.signIn',
      url:"signIn",
      component: SignIn,
    },
    {
      name: 'app.signUp',
      url:"signUp",
      component: SignUp,
    }
  ]
}
